import { combineReducers } from "redux";
import preventReducer from "./prevent/preventReducer";
import { persistStore, persistReducer } from "redux-persist";
import userReducer from "./user/userReducer";

const persistConfig = {
  key: "root",
  storage,
};

const persistedpreventReducer = persistReducer(persistConfig, preventReducer);

const rootReducer = combineReducers({
  user: userReducer,
  prevent: persistedpreventReducer,
});

export default rootReducer;
